import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Login from '../Login';
import Dashboard from '../Dashboard';
import PageNotFound from '../PageNotFound';
import { StyledEngineProvider } from '@mui/material/styles';
import { useState } from 'react';

export interface AppProps {}

const loginCreds = {
  username: 'username',
  password: 'pass'
};

const App: React.FunctionComponent<AppProps> = () => {
  const [user, setUser] = useState({ username: '', password: '' });
  const [error, setError] = useState('');

  const loginNow = ({ ...credentials }) => {
    console.log('Credentials', credentials);
    if (credentials.username === loginCreds.username && credentials.password === loginCreds.password) {
      console.log('Successfully Logged in!');
      setUser({ username: credentials.username, password: credentials.password });
    } else {
      console.log('Credentials do not match');
      setError('Credentials do not Match');
    }
  };

  const Logout = () => {
    setUser({ username: '', password: '' });
  };

  return (
    <div className="App">
      <StyledEngineProvider injectFirst>
        <Switch>
          <Route path="/login" element={<Login login={loginNow} error={error} />} />
          <Route path="/dashboard" element={<Dashboard logout={Logout} />} />
          <Route path="*" element={<PageNotFound />} />
        </Switch>
      </StyledEngineProvider>
    </div>
  );
};

export default App;
